import React, { useEffect, useState } from "react";
import { useAuthUser } from "../security/AuthContext";
import { useNavigate, useLocation } from "react-router-dom";
import "../style/carts.css";

export default function Cart() {
  const [cartItems, setCartItems] = useState([]);
  const { isAuthenticated } = useAuthUser();
  const navigate = useNavigate();
  const location = useLocation();

  useEffect(() => {
    if (!isAuthenticated) {
      navigate('/login', { state: { from: location.pathname } });
      return;
    }
    fetchCartItems();
  }, [isAuthenticated, navigate, location]);

  const fetchCartItems = async () => {
    try {
      const res = await fetch(`${process.env.REACT_APP_API_URL}/cart`, {
        credentials: "include",
      });
      if (res.ok) {
        const data = await res.json();
        setCartItems(data);
      }
    } catch (error) {
      console.error("Error fetching cart items:", error);
    }
  };

  const handleUpdateQuantity = async (id, quantity) => {
    if (quantity < 1) return;
    try {
      const res = await fetch(`${process.env.REACT_APP_API_URL}/cart/${id}`, {
        method: "PUT",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify({ quantity }),
        credentials: "include",
      });
      if (res.ok) {
        setCartItems((prev) =>
          prev.map((item) => (item.id === id ? { ...item, quantity } : item))
        );
      }
    } catch (error) {
      console.error("Error updating quantity:", error);
    }
  };

  const handleDeleteItem = async (id) => {
    try {
      const res = await fetch(`${process.env.REACT_APP_API_URL}/cart/${id}`, {
        method: "DELETE",
        credentials: "include",
      });
      if (res.ok) {
        setCartItems((prev) => prev.filter((item) => item.id !== id));
      }
    } catch (error) {
      console.error("Error deleting item:", error);
    }
  };

  const handleCheckout = () => {
    alert("Proceeding to checkout!");
  };

  if (!cartItems.length) {
    return (
      <div className="cart-container">
        <div className="cart-header">
          <h1>Shopping Cart</h1>
        </div>
        <div className="empty-cart">
          Your cart is empty
        </div>
      </div>
    );
  }

  return (
    <div className="cart-container">
      <div className="cart-header">
        <h1>Shopping Cart</h1>
      </div>
      <div className="cart-items">
        {cartItems.map((item) => (
          <div key={item.id} className="cart-item">
            <div className="cart-item-info">
              <span className="product-name">{item.product.name}</span>
              <div className="quantity-controls">
                <button 
                  className="quantity-btn"
                  onClick={() => handleUpdateQuantity(item.id, item.quantity - 1)}
                >
                  -
                </button>
                <span className="quantity">{item.quantity}</span>
                <button 
                  className="quantity-btn"
                  onClick={() => handleUpdateQuantity(item.id, item.quantity + 1)}
                >
                  +
                </button>
              </div>
              <span className="item-price">${(item.product.price * item.quantity).toFixed(2)}</span>
            </div>
            <button 
              className="remove-btn"
              onClick={() => handleDeleteItem(item.id)}
            >
              Remove
            </button>
          </div>
        ))}
      </div>
      <div className="checkout-section">
        <div className="cart-total">
          Total: ${cartItems.reduce((sum, item) => sum + (item.product.price * item.quantity), 0).toFixed(2)}
        </div>
        <button className="btn-checkout" onClick={handleCheckout}>
          Checkout
        </button>
      </div>
    </div>
  );
}
